  {name: "Amazon Fire TV Stick", price: 39.99, description: "Fire TV Stick connects to your TV's HDMI port. It's an easy way to enjoy over 250,000 TV episodes and movies on Netflix, Amazon Video, HBO GO, and Hulu, plus games, music, and more\nCutting the cord? Watch the best of live TV on NBC News, NBA, and Sling TV, which includes ESPN, CNN, HDTV, AMC, A&E, Cartoon Network, and more.\n4x the storage and 2x the memory of Chromecast plus a dual-core processor and 1 GB of memory\nNo more buffering, ASAP learns what Amazon movies and shows you like so they start instantly\nNever miss out. Bring Fire TV Stick with you to watch your favorites away from home, even in hotels and dorm rooms.\nAmazon Prime members get unlimited access to Prime Video, including original programming like Transparent, plus over 1 million songs with Prime Music\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41KqCrQ2fuL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Amazon-W87CUN-Fire-TV-Stick/dp/B00GDQ0RMG%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00GDQ0RMG", rating: 0.0, category: "Amazon SMP"},
  {name: "Fire, 7\" Display, Wi-Fi, 8 GB - Includes Special Offers, Black", price: 49.99, description: "Beautiful 7\" IPS display (171 ppi / 1024 x 600) and fast 1.3 GHz quad-core processor. Rear and front-facing cameras.\nAll-new Amazon Underground, a one-of-a-kind app store experience where over $10,000 in apps, games and even in-app items are actually free - including extra lives, unlocked levels, unlimited add-on packs and more\nEnjoy more than 38 million movies, TV shows, songs, books, apps and games\n8 GB of internal storage.  Free unlimited cloud storage for all Amazon content and photos taken with Fire devices. Add a microSD card for up to 128 GB of additional storage.\nUpdated user interface - Fire OS 5 designed for quick access to your apps and content plus personalized recommendations that make it easy to discover new favorites\nUp to 7 hours of reading, surfing the web, watching videos, and listening to music\nStay connected with fast web browsing, email, and calendar support\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51ENctTSxaL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Fire-Display-Wi-Fi-GB-Includes/dp/B00TSUGXKE%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00TSUGXKE", rating: 4.2, category: "Amazon Tablets"},
  {name: "Amazon Fire TV", price: 99.99, description: "All-new Amazon Fire TV now supports 4K Ultra HD for true-to-life picture quality. Watch high-definition 1080p streams on Amazon Video, Netflix, Hulu and more, even without a 4K TV.\nNow with Alexa, use your Fire TV Voice Remote to check sports scores or the weather, play music, and more - instantly\nEnjoy over 250,000 TV episodes and movies on Netflix, Amazon Video, HBO GO, and Showtime Anytime, plus games, music, and apps\nCutting the cord? Watch the best of live TV on NBC News, NBA, and Sling TV, which includes ESPN, CNN, HDTV, AMC, A&E, Cartoon Network, and more.\nSay it. Watch it. Simply say the name of what you want to watch and start enjoying in seconds.\nNow with 75% more processing power, a dedicated graphics engine, better Wi-Fi support, 2 GB of memory, 8 GB of storage and expandable storage of up to 128 GB\nWith over 800 games - the most games of any other streaming media player - there is something for the entire family, including Minecraft, Lego Star Wars, and Pac-Man 256\nAmazon Prime members get unlimited access to Prime Video, including original programming like Transparent, plus over 1 million songs with Prime Music\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/31t3CwdjAXL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Amazon-DV83YW-Fire-TV/dp/B00U3FPN4U%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00U3FPN4U", rating: 0.0, category: "Amazon SMP"},
