  {name: "Amazon Music with Prime Music [PC] [Download]", price: 0.0, description: "Lets you play, manage and download all your music with ease and convenience.\nAmazon Prime customers get unlimited, ad-free access to over a million songs and hundreds of playlists for free.\nIncorporates 'smart' features to ensure that you get the most out of your music experience with the least amount of effort.\nAmazon Music for PC is fast. It'll get you from launch to play in seconds.\nAmazon Music for PC detects and adds new music to your library even if you bought it from iTunes or ripped a CD. Your music library will always be organized and up-to-date.\nSystem Requirements: Windows 8, Windows 7, Windows Vista, Windows XP SP3\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41683%2B%2B39BL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Amazon-Music-Prime-PC-Download/dp/B00CTTEKJW%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00CTTEKJW", rating: 3.9, category: "Digital Software"},
