  {name: "NeuTab® N7 Pro 7'' Quad Core Google Android 4.4 KitKat Tablet PC, HD 1024X600 Display, Bluetooth, Dual Camera, Google Play Pre-loaded, 3D-Game Supported (White)", price: 49.99, description: "Enhanced performance: Featuring a powerful and robust Quad-Core CPU, NeuTab N7 Pro ensures quick app launches and ultra-smooth gaming. Android 4.4 KitKat enables quicker multitasking without sacrificing its performance.\nStay connected: Built-in Bluetooth allows easy pairing with speakers, keyboard, and other Bluetooth-enabled devices which makes your N7 Pro tablet powerful multi-media. Built-in Wi-Fi enables you stay connected on the go and fast web browsing.\nExpanded storage: An 8GB nand flash enables you to download thousands of apps from Google Play Store and Micro SD card slot allows adding up to 32GB of extra space to store songs, videos, photos and other files.\nUnlimited entertainment: Enjoy access to an ever-expanding world of music, movies, TV shows, books, Android apps, and games with Google Play. N7 Pro HD high resolution screen offers rich graphics, bright colors, and crisp text.\nLocal supported customer service: NeuTab offers 1 year manufacturer defect warranty. In addition, our US-based local customer service and tech support guarantees quick response to your questions via email and local phone call. SquareTrade offers extended coverage protection against accidental drop, water damage, etc. Please feel free to contact us whenever a question pops up in your head, we are always here to help.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51-4qgj77gL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/NeuTab-N7-Pro-Bluetooth-Pre-loaded/dp/B00PMDEAYW%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00PMDEAYW", rating: 0.0, category: "Personal Computer"},
  {name: "Alldaymall A88X 7'' inch Quad Core Google Android 4.4 KitKat Tablet PC , HD Dual Camera, 1024x600 HD Display, 8GB Nand Flash, Bluetooth, Google Play Pre-load, 3D Game Supported Black", price: 39.99, description: "This Alldaymall android tablet featuring the incredible powerful Allwinner Quad Core A33, up to four times faster CPU, ensures faster multitasking speed than ever. With the super-portable size, you get a robust power in a device that can be taken everywhere.\nThe HD 1024x600 high resolution 7'' display delivers crisp and clear content, making it a enjoyable experience for watching, reading or gaming. An 8GB nand flash allows you to download thousands of apps from Google Play Store, such as Angry Birds, Fruit Ninja, Temple Run, Quickoffice, etc.\nThe Google Android 4.4 KitKat brings many more new features. Using the emoji icons, your conversations will be more interesting. Voice search, open or save files on Google Drive etc offer great convenience. And there're more surprises for you!\nThe built-in Wi-Fi (802.11 b/g/n) enables you stay connected on the go. With the dual camera, there's more to share. Take videos, snap more clear pictures with the 2.0MP rear camera and easily post them to FaceBook and Twitter. While, video chatting with friends or families, the 2.0MP front camera makes a difference.\nSupported and fully warrantied by Alldaymall!\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/514EwHS3hiL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Alldaymall-A88X-1024x600-Bluetooth-Supported/dp/B00MXXJLTS%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00MXXJLTS", rating: 0.0, category: "Personal Computer"},
  {name: "Tagital® T7X 7\" Quad Core Android 4.4 KitKat Tablet PC, Bluetooth, Dual Camera, Google Play Store Pre-installed, 3D Game Supported, 2015 Newest Model- Pink", price: 39.99, description: "Newest Solution: The Tagital Newest tablet is equipped with ARM A33 Cortex-A7 Quad-Core high-speed processing platform. The A33 solution is the upgrade to A23, the latest version and give you the more fantastic experience. You will not have any lag on web browsing. Just enjoy the games, videos, movies etc with Tagital at ease.\nThe Google Android 4.4 OS: The latest version of the industry standard for high performance graphics. Reveals tons of new adventures to your tablet. Easy multi-tasking, rich notifications, resizable widgets and deep interactivity. The device will allow you the best experience inside out.\nUltra-fast web browsing: Built-in Wi-Fi (802.11b/g/n). Browse websites, stream videos and movies on the go. Plus, USB on the go (OTG) supported, plug in your keyboard and mouse then you can use it as a computer!\nWith the dual camera, there's more to share. Take videos, snap more clear pictures with the 2.0MP rear camera and easily post them to FaceBook and Twitter. While, video chatting with friends or families, the 2.0MP front camera makes a difference.\nLive US local customer service and tech support. Frequently updated firmware guarantees customer satisfaction. Feel free to contact us whenever a question pops up in your head, we are always here to help.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51sLCC7b7NL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Tagital%C2%AE-T7X-Bluetooth-Pre-installed-Supported/dp/B00YK1O24A%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00YK1O24A", rating: 0.0, category: "Personal Computer"},
  {name: "NeuTab® 10.1 Inch Octa Core Android 5.1 Lollipop System Tablet 1GB RAM 16GB ROM Bluetooth 4.0 Dual Camera Mini HDMI output Slim Design Black", price: 99.99, description: "Ultimate multimedia experience: Featuring the latest Octa Core CPU and Google Android 5.1 Lollipop OS, NeuTab newest model N10 Plus ensures an impressive smooth gaming and ultimate multimedia experience. The ultrafast and powerful A83T processor enables quick app launches and fluid graphics.\nUnique power-saving design: With Cortex-A7 CPU architecture and the performance power balanced GPU, N10 Plus consumes much less power than most quad-core tablets and the power-saving design enables extended battery life.\nEndless entertainment and amazing 3D gaming experience: With 1GM RAM and A83T processor, you can download all your favorite apps seamlessly. Built-in Bluetooth 4.0 allows easy pairing with speakers, keyboard, and game controller, etc. With HDMI (High Definition Multimedia Interface), you can easily connect your tablet into just about any TV and start streaming your favorite content and turns your game playing a much more enjoyable experience.\nBeautiful display: With wide viewing angles up to 160 degree and 10.1-inch screen, the N10 Plus tablet is perfect for watching movies, playing games or reading books. A83T Octa-core integrates Allwinner next-gen SmartColor display technology which provides higher image quality and better visual effects. The clear and bright color and beautiful display allows you to experience rich and vivid graphics and crisp text.\nLocal supported customer service: NeuTab offers 1 year manufacturer defect warranty. Also our US-based local customer service and tech support ensures quick response to your questions via email and local phone call. Feel free to contact us whenever a question pops up in your head, we are always here to help.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51eyAYG7%2B5L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/NeuTab-Android-Lollipop-System-Bluetooth/dp/B015K2A5AM%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB015K2A5AM", rating: 0.0, category: "Personal Computer"},
