  {name: "Dragon Touch 7\" Quad Core Android Kids Tablet, with Wifi and Camera and Games, HD Kids Edition w/ Zoodles Pre-Installed (2015 New Model, Y88X with Red Silicone Case)", price: 59.99, description: "Best tablet both for kids and parents--With Zoodles pre-installed, there's no need to worry about unfriendly content on the Internet. With a Quad Core CPU, it delivers the perfect mix of power, portability, and performance. You will get an all-in-one powerful device. NOTE: This product is NOT Bluetooth Compatible\nGreat for kids--With Zoodles, kids can have their own personal playground and the Child Friendly Interface makes it easy to use. They can get access to fun and educational games and videos which you choose for them. All the content in Zoodles adapts to your child's age and skill level. So they are always playing and learning at the highest level.\nGreat for parents--With Quad Core, everything boots up quickly. It's perfect for reading and watching video as the HD Screen delivers clear contents. The Parent Play Along mode in Zoodles gives you full access to sites and more freedom to guide your child's experience.\nKid-Proof Case--Durable, lightweight case to protect against drops and bumps caused by kids at play. Made of high quality soft silicone material, the bundled case is environment-friendly and harmless to health. No need to worry about any potential harms. The soft material brings soft and smooth touch experience.\nRobust warranty, on-time customer service/tech support, frequently updated firmware guarantees customer satisfactory. Feel free to contact us whenever a question pops up in your head, we are always here to help. To purchase a Tabsuit accessories package for Dragon Touch Y88X Kids Tab which includes 3 pack screen protectors, type in the following code in the amazon search box B00VHYXXIE\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51i7vgRHz9L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_a