  {name: "Dragon Touch X10 10 inch Octa Core Android Tablet PC, 1GB RAM 16GB Nand Flash, IPS Display 1366x768, 5.0MP Camera w/AutoFocus, Bluetooth, Mini HDMI Output, 1 Year US Warrany", price: 119.99, description: "Unbeatable Performance: Featuring a powerful and robust Octa-Core CPU -- 8X Cortex A7 that runs up to 2.0 GHz and a Octa-Core high-speed PowerVR SGX544 GPU, Dragon Touch X10 provides the most speedy experience for multi-tasking: gaming, watching video, listening to music, etc. What's more, video streaming is much faster with H.265 decoding.\nBrilliant Display: Powered by SmartColor Technology, the 10 inch IPS Display with 1366x768 Resolution will never miss any detail. Sharing the big screen with families is much more enjoyable via the 178-degree view angle. With 10 point multi-touch technology, it's more accurate and responsive.\nMulti Function: Improved Wi-Fi module enables you experience faster loading speed for browsing the web, streaming music, making video calls and more. Built-in Bluetooth allows pair with Bluetooth devices. The mini HDMI port simplifies syncing your screen to HDTV. It even could power up other device via the Standard USB port.\nUnlimited Entertainment: Pre-installed Google Play brings you to the world of entertainment, tons of Apps for gaming, social, sharing are available, such as Facebook,Twitter, Netflix, Instagram, etc. Equipped with a 5.0MP rear camera and a 2.0MP front camera with auto focus, X10 lets you take photos and video chat with friends and family members.\nUS Local Customer Service: on-time customer service/tech support, frequently updated firmware guarantees customer satisfactory. Feel free to contact us whenever a question pops up in your head, we are always here to help.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/21DXurERecL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Dragon-Touch-X10-AutoFocus-Bluetooth/dp/B00ZZOXCOC%3FSubsc