  {name: "NeuTab® N7 Pro 7'' Quad Core Google Android 4.4 KitKat Tablet PC, HD 1024X600 Display, Bluetooth, Dual Camera, Google Play Pre-loaded, 3D-Game Supported (Black)", price: 49.99, description: "Enhanced performance: Featuring a powerful and robust Quad-Core CPU, NeuTab N7 Pro ensures quick app launches and ultra-smooth gaming. Android 4.4 KitKat enables quicker multitasking without sacrificing its performance.\nStay connected: Built-in Bluetooth allows easy pairing with speakers, keyboard, and other Bluetooth-enabled devices which makes your N7 Pro tablet powerful multi-media. Built-in Wi-Fi enables you stay connected on the go and fast web browsing.\nExpanded storage: An 8GB nand flash enables you to download thousands of apps from Google Play Store and Micro SD card slot allows adding up to 32GB of extra space to store songs, videos, photos and other files.\nUnlimited entertainment: Enjoy access to an ever-expanding world of music, movies, TV shows, books, Android apps, and games with Google Play. N7 Pro HD high resolution screen offers rich graphics, bright colors, and crisp text.\nLocal supported customer service: NeuTab offers 1 year manufacturer defect warranty. In addition, our US-based local customer service and tech support guarantees quick response to your questions via email and local phone call. SquareTrade offers extended coverage protection against accidental drop, water damage, etc. Please feel free to contact us whenever a question pops up in your head, we are always here to help.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51pEJ055%2BDL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/NeuTab-N7-Pro-Bluetooth-Pre-loaded/dp/B00THEMRX8%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00THEMRX8", rating: 0.0, category: "Personal Computer"},
