  {name: "Fire Kids Edition, 7\" Display, Wi-Fi, 8 GB, Blue Kid-Proof Case", price: 99.99, description: "Up to $109 in savings on Fire, 1 year of Amazon FreeTime Unlimited and a Kid-Proof Case, plus a 2-year worry-free guarantee\nNot a toy, a full-featured Fire tablet with a 7\" IPS display and front and rear cameras. Add a microSD card for up to 128 GB of additional storage.\n2-year worry-free guarantee: if they break it, return it and we'll replace it for free. No questions asked.\nUnlimited, free access to 10,000 kid-friendly books, movies, TV shows, educational apps, and games with 1 year of Amazon FreeTime Unlimited included\nBest-in-class parental controls allow you to manage usage limits, content access, and educational goals\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/518HznKZ9HL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Fire-Edition-Display-Wi-Fi-Kid-Proof/dp/B00YYZEQ1G%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00YYZEQ1G", rating: 4.0, category: "Amazon Tablets"},
