  {name: "Fire HD 10, 10.1\" HD Display, Wi-Fi, 16 GB - Includes Special Offers, Black", price: 229.99, description: "Our largest display on our thinnest tablet yet, lighter and almost 2x more durable than the latest iPad Air\nBeautiful widescreen 10.1\" HD display with over a million pixels (149 ppi / 1280 x 800)\nFast quad-core processor up to 1.5 GHz. Rear-facing 5 MP camera and front-facing HD camera.\nAll-new Amazon Underground, a one-of-a-kind app store experience where over $10,000 in apps, games and even in-app items are actually free - including extra lives, unlocked levels, unlimited add-on packs and more\nEnjoy more than 38 million movies, TV shows, songs, books, apps and games\n16 GB or 32 GB of internal storage.  Free unlimited cloud storage for all Amazon content and photos taken with Fire devices. Add a microSD card for up to 128 GB of additional storage.\nUp to 8 hours of reading, surfing the web, watching video, and listening to music\nUpdated user interface - Fire OS 5 designed for quick access to your apps and content plus personalized recommendations that make it easy to discover new favorites\nStay connected with fast web browsing, email and calendar support\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41FdjwzE3-L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Fire-HD-10-1-Display-Wi-Fi/dp/B00VKIY9RG%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00VKIY9RG", rating: 3.9, category: "Amazon Tablets"},
