  {name: "NeuTab® K1 10.1 Inch Quad Core Tablet PC Google Android 5.1 Lollipop System 1GB RAM 16GB Nand Flash Dual Camera Built-in Bluetooth 4.0 HDMI Output GPS Supported", price: 89.99, description: "Ultimate multimedia experience: Featuring a stable MTK Quad Core CPU and Google Android 5.1 Lollipop OS, NeuTab new model K1 ensures an impressive smooth gaming and ultimate multimedia experience.\nEndless entertainment and amazing 3D gaming experience: With 1 GM RAM and 16 GB Nand flash, you can download all your favorite apps seamlessly. With mini HDMI port, you can easily connect your tablet into just about any TV and start streaming your favorite content and turns your game playing a much more enjoyable experience.\nBeautiful Widescreen Display: Ideal for watching HD movies, playing games, browsing the web, or reading and you experience rich graphics, bright colors, and crisp text. Widescreen displays exceptional detail and the bigger screen makes the games buttons easier to press and tapping a more accurate experience.\nStay connected and productive: Built-in Wi-Fi (802.11 a/b/g/n) allows for Ultra-fast web browsing and emails. Unique power-saving design enables extended battery life. Use up to 8 hours on a full battery charge.\nLocal supported customer service: NeuTab offers 1 year manufacturer defect warranty. Also our US-based local customer service and tech support ensures quick response to your questions via email and local phone call. Feel free to contact us whenever a question pops up in your head, we are always here to help.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51NAan7Z2CL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/NeuTab-K1-Lollipop-Bluetooth-Supported/dp/B0147NYDB2%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB0147NYDB2", rating: 0.0, category: "Personal Computer"},
  {name: "NeuTab® G7 7 inch 4G LTE Quad Core Tablet PC Google Android 5.0 Lollipop IPS 1024x600 HD Display Bluetooth GPS Supported Dual HD Camera Unlocked GSM Dual Sim Slot 4G/3G/2G Android Phone Phablet", price: 79.99, description: "As an integration of tablet and phone, NeuTab unlocked 7-inch G7 phablet features a powerful MediaTek Quad-Core CPU and Android 5.0 Lollipop OS, giving it a significant performance boost over competing devices and ensuring an impressive smooth multi-tasking.\nCompatible with GSM carriers such as AT&T and T-Mobile, but not compatible with CDMA carriers such as Verizon and Sprint. 4G LTE / 3G / 2G network supported (please check with your phone carrier for compatibility and data plan details).\nPre-installed Google Play Store allows you to enjoy access to an ever-expanding world of music, movies, and your favorite apps. Built-in Bluetooth ensures easy pairing with speakers, keyboard, and game controller, etc. With GPS, your phablet can be turned into a handy travel assistant as a GPS navigator with SIM card inserted (Please install appropriate navigation app, data will be consumed).\nWith a viewing angle of 178 degrees, the IPS screen offers crystal clear and vivid images, allowing you to see bright and rich colors from virtually every angle, which is perfect for watching movies, surfing, gaming and reading eBooks. Comes with dual SIM card slots, one for work and another one for personal connection so work and life can be switched as you wish.\nNeuTab offers 1 year manufacturer defect warranty. Our US-based local customer service and tech support ensures quick response to your questions via email and local phone call. Feel free to contact us whenever a question pops up in your head, we are always here to help.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51ZO8yFMckL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/NeuTab-G7-Lollipop-Bluetooth-Supported/dp/B0