  {name: "Dragon Touch Y88X Plus 7'' Quad Core Google Android 4.4 KitKat Tablet PC, IPS Display, HD Screen 1024 x 600, 8 GB, Bluetooth, Dual Camera, Netflix, Skype, 3D Game Supported - Graphite Black", price: 49.99, description: "Ultrafast and Fluid Performance: Featuring the incredibly powerful Allwinner Quad Core A33 chip, this Y88X Plus model delivers ultrafast multitasking speed and rivals many 7 inch tablets. Everything is more responsive and fluid. Combined with KitKat 4.4 OS, 8GB memory (expandable with SD card) and its super-portable size, Y88X Plus will prove to be a necessary for travel of choices.\nStunning Viewing Experience: Casting off the original normal TN screen, this tablet sports the 178 degree view IPS display which presents best graphics performance to you. Packed with the upgraded camera and SmartColor display technology of the A33 chip, you can take dazzling photos and videos. Contents become incredibly detailed and razor sharp on this little thing. The world is so close and so clear to you, and changes under your fingertips.\nAdvanced Wireless, Worry-free Mobility: Stay connected on the go with the built-in Wi-Fi. Wherever there is Wi-Fi, you can link yourself to the world. Beyond that, the built-in Bluetooth transforms your Y88X+ into powerful multi-media. You can easily pair it with keyboards, speakers and other Bluetooth devices, making your work and life much more convenient and enjoyable.\nY88X+ has the Google Play store pre-loaded, providing you access to countless apps that make the tablet whatever you want it to be. More than 500,000 apps out there awaiting your summon. And with the pre-installed world's #1 kid app, Zoodles, you can easily schedule your kids' learning and playing on the tablet, and synchronize yourself with their dynamics.\n1 YEAR Limited warranty! on-time customer service/tech support, frequently updated firmware, guarantees customer satisfactory. Feel free to contact us whenever a question pops up in your head, we are always here to help.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51vSBVvJaML.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Dragon-Touch-Android-Bluetooth-Supported/dp/B015K3APWO%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB015K3APWO", rating: 4.8, category: "Personal Computer"},
  {name: "Fire Kids Edition, 7\" Display, Wi-Fi, 8 GB, Pink Kid-Proof Case", price: 99.99, description: "Up to $109 in savings on Fire, 1 year of Amazon FreeTime Unlimited and a Kid-Proof Case, plus a 2-year worry-free guarantee\nNot a toy, a full-featured Fire tablet with a 7\" IPS display and front and rear cameras. Add a microSD card for up to 128 GB of additional storage.\n2-year worry-free guarantee: if they break it, return it and we'll replace it for free. No questions asked.\nUnlimited, free access to 10,000 kid-friendly books, movies, TV shows, educational apps, and games with 1 year of Amazon FreeTime Unlimited included\nBest-in-class parental controls allow you to manage usage limits, content access, and educational goals\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51EfPKrH6RL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Fire-Edition-Display-Wi-Fi-Kid-Proof/dp/B00YYZCUGO%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00YYZCUGO", rating: 4.0, category: "Amazon Tablets"},
