5\" x 1.1\" x 2.4\" (W x H x D). Weight: 0.875 lbs.Color: Black/Silver. Warranty: One Year Limited Manufacturer Warranty.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41tern755iL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/NEW-D-Link-2-Port-Switch-Audio/dp/B00PYJ71IG%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00PYJ71IG", rating: 0.0, category: "PC Accessory"},
