tal factors, we cannot guarantee reception in all conditions. We do offer a 30 day money back guarantee on all new items in order for you to test the suitability in your area.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41j-ruCEeWL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Amplified-HDTV-Antenna-Detachable-Performance/dp/B00IF70T4M%3Fpsc%3D1%26SubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00IF70T4M", rating: 0.0, category: "CE"},
