  {name: "ESI Maya 44 XTe 4-in/4-out PCIe Sound Card Audio Interface", price: 179.96, description: "The MAYA44 XTe is a high quality 24-bit / 96 kHz 4-in / 4-out PCIe audio interface, providing a number of powerful and amazing features optimized for home recording on a professional quality level and for various DJ applications.\nThe card can easily be used by home users making their first steps in computer audio as well as by professionals who produce music on a budget, looking for a professional, yet affordable, PCIe audio solution.\nMAYA44 XTe provides 2 stereo analog line inputs, 2 stereo line outputs, a microphone input with +48V phantom power and preamp, a Hi-Z guitar instrument input, a headphone output, as well as an optical S/PDIF output and an optical S/PDIF input.\nMAYA44 XTe comes with a powerful software package that allows you to start using the hardware right out of the box.\nThe main item provided on a separate DVD is Cubase LE 5 from Steinberg that runs perfectly under Windows XP, Windows Vista, Windows 7 and Mac OS X.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51Jk7KHzPiL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/ESI-4-out-Sound-Audio-Interface/dp/B005CV3PNQ%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB005CV3PNQ", rating: 5.0, category: "PC Accessory"},
