  {name: "Sound Oasis Wilderness Journey Sound Card", price: 8.5, description: "Add more sounds to your Sound Oasis Sound Therapy System for added variety.\nContains 6, authentic, digitally recorded sounds.\nIncludes the following 6 sounds: Thunderstorm in the Wilderness; Loons on Wilderness Lake; Mountain Valley Windstorm; Forest Rain; Waterfall; Roaring Bonfire.\nSimply insert into the Sound Card slot on the Sound Oasis S-550-03 model.\nDoes not fit other Sound Oasis models.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/51I2laoQIXL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Sound-Oasis-Wilderness-Journey-Card/dp/B001ULD18G%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB001ULD18G", rating: 0.0, category: "Health and Beauty"},
  {name: "External Sound Card 5.1 Surround USB Powered Laptop Notebook PC Audio Adapter", price: 6.99, description: "USB sound is an USB audio controller. It supports 32KBz,44.1khz(which two need driver or application software support) and 48 KHz samling rate in digital recording. 48KHz sampling in analog recordin and 48 KHz in digital/analog audio playback.\nIn digital playback mode,it receives audio stream from PC via USB interface and transmits audio data according to the AES/EBU,IEC60958,S/PDIF consumer interface standards. Only R,L channel PCM audio in 5.1 channel can be conveyed in digital playback mode. In analog playback mode, it supports 6 channels codes for analog playback.\nIn digital recording mode, it receives S/PDIF digital audio input and sends back to PC through USB. Three sampling rates; includes 32KHz,44.1KHz are automatically locked internally. In analog recording mode, fixed 48KHz sampling rate is supported by analog audio recording.\nSupports AES/EBU.IEC60958,S/PDIF consumer formats for stereo PCM audio.\nFixed 48KHz sampling rate for 5.1 channel playback.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41VwvDKDeyL.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/External-Surround-Powered-Notebook-Adapter/dp/B008AH9U6K%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB008AH9U6K", rating: 3.0, category: "CE"},
