  {name: "Microsoft Surface Pro 128GB -  Black Windows Tablet (Spanish, Portuguese, and Italian only)", price: 499.99, description: "-Ports and connectivity Bring your entire media collection with you wherever you go. A microSDXC card slot lets you add up to 64GB of extra storage. Show off everything on the big screen using the mini DisplayPort3. Full-size USB port and Bluetooth 4.0 provide clutter-free connections with wireless mice and headsets. Dual 2x2 MIMO antennas provide reliable internet connectivity.\n-Pen Get creative with drawing and note taking in applications such as OneNote1. Mark up your PowerPoint presentations, PDFs, and documents just like you would on paper. A pen digitizer and pen come with your device, making it easy to add a personal touch.\n-VaporMg casing and Integrated Kickstand Made with VaporMg, Surface is precision crafted to be tough yet elegant, without excessive bulk. At 2 pounds, with a watch-like finish thats incredibly smooth and durable. Flip out the Kickstand for hands-free entertainment.\n-Powered by Windows 8 Windows has been reimagined to focus on your life. The beautiful, fast and fluid design is perfect for a range of hardware: from compact, touch-enabled tablets and lightweight laptops, to PCs and large, powerful all-in-ones with high-definition screens.\n-Intel i5 processor Enjoy fast, powerful performance and stunning visuals. The Intel i5 processor was built using the latest technologies, including HD graphics, to deliver with impressive speed and responsiveness. Run Outlook1, Office 3651, and Desktop Apps such as Quicken and Adobe Photoshop.\n", photo: nil, photo_file_name: "http://ecx.images-amazon.com/images/I/41XbnT91I6L.jpg", photo_content_type: nil, photo_file_size: nil, photo_updated_at: nil, url: "http://www.amazon.com/Microsoft-Surface-Pro-128GB-Portuguese/dp/B00BE5T2TA%3FSubscriptionId%3DAKIAIOIQ7RVLXBLE63QA%26tag%3Dfasthall-20%26linkCode%3Dxm2%26camp%3D2025%26creative%3D165953%26creativeASIN%3DB00BE5T2TA", rati